Text:
@vijca333 Hey Vinod, sorry to hear about the inconvenience. You may be facing an issue while purchasing the ride pass because of the following reasons:

- An outstanding charge needs to be cleared on your account
- The PayTm authorization on your Uber account may have expired

@vijca333 In order to purchase the ride pass, we request you to clear the outstanding balance on your account:

- Try requesting a trip to generate the arrears prompt message
- Clear the arrears using any non-cash payment method available on your account

@vijaykrishnavis Hey Vijay, happy to clarify this for you  
1. You can schedule UberIntercity rides. 
2. Intercity rides are payable only by cash. (1)

@vijaykrishnavis 3. You will receive a notification containing the assigned driver details 15 minutes prior the scheduled time subject to availability at that time in your vicinity. (2)

For more details regarding an UberIntercity visit  https://t.co/uk7uWwTHkS

Appreciate your understanding.

@vijaykrishnavis Hey Vijaykrishna, please refer to the link given below to schedule a ride: 
https://t.co/JE96jh2php
Also, when you enter the destination, the app should show an option to schedule an intercity according to the availability in your area. https://t.co/5hOwY5koe1
